[
A Little About The Salty!
]
[
The idea of the Salty Pelican Bar & Grill started over some cold ones during Happy Hour one summer afternoon. Owners Al Waldis and T.J. Pelletier set out on a mission to create an experience that encompasses an exciting location, great food, and a fun atmosphere. After searching all over, we chose the exact spot you are sitting right now, and the rest is history. The Salty Pelican takes pride in our friendly service, large craft beer selection, and creating dishes such as our Signature Broiled Oysters and our famous Tuna Nachos. We thank you for your business and can’t wait to see you again and again!
]
[
Our mission is to deliver high quality, consistent food and beverage through friendly, genuine service in the perfect location.
]
[
Sports Fans!  NFL SUNDAY TICKET IS HERE!
]
[
The Salty Pelican carries all major sporting events including NFL Sunday Ticket, Baseball, Basketball, Hockey, College Football, and more!
]
[
We want our guests to have just as much fun
as we have day in and day out!!!
]
[
We thank you for visiting our website
and can’t wait to see you soon!
]
[
*The Salty Pelican is a Smoke and Vape Free Property.
